import Img1 from './img/himym.jpg'
import Img2 from './img/bigbang.jpg'
import Img3 from './img/friends.jpg'
import Img4 from './img/heist.jpg.jpg'
const MovieList = [
    {
        img: Img1,
        title: 'How I met your Mother'
    },
    {
        img: Img2,
        title: 'Big Bang Theory'
    },
    {
        img: Img3,
        title: 'Friends'
    },
    {
        img: Img4,
        title: 'Money Heist'
    }
]
export default MovieList
